import './main.css';

const Main = (props) => {
    return (
        <div className='listadejobs'>
            <div className='listadejobs_job01'>
                <img src='/imagens/photosnap.svg'/>{props}
                <p>Photosnap</p>
                <h1>Desenvolvedor Senior Frontend</h1>
                <p>1 Dia Atrás - Tempo Integral - Remoto</p>
            </div>
            <div className='listadejobs_job02'>
                <img src='/imagens/manage.svg'/>
                <p>Manage</p>
                <h1>Desenvolvedor Fullstack</h1>
                <p>1 Dia atrás - Meio Turno - Remoto</p>
            </div>
        </div>
    );
}

export default Main;
